import React from "react";
import About from "./About";
import Products from "./Products";
import OurValues from "./OurValues";
import Contact from "./Contact";

const Home = () => {
  return (
    <div className="section">
      <h1>Welcome to MittalFood Products</h1>
      <p>Discover the finest food products with us.</p>

      <About style={{ display: selectedTab === "about" ? "block" : "none" }} />
      <Products style={{ display: selectedTab === "products" ? "block" : "none" }} />
      <OurValues style={{ display: selectedTab === "values" ? "block" : "none" }} />
      <Contact style={{ display: selectedTab === "contact" ? "block" : "none" }} />

      {/* Add your tabs here with onClick handlers */}
      <div className="tab" onClick={() => handleTabChange("home")}>Home</div>
      <div className="tab" onClick={() => handleTabChange("about")}>About Us</div>
      <div className="tab" onClick={() => handleTabChange("products")}>Products</div>
      <div className="tab" onClick={() => handleTabChange("values")}>Our Values</div>
      <div className="tab" onClick={() => handleTabChange("contact")}>Contact Us</div>
    </div>
  );
};

export default Home;
